## An example for hoisting

**Both `let` and `var` hoisting. Accessing the variable before initialization will throw error on `let` but only returns `undefined` on `var`.**
```js
let a = 0;
function main1() {
  console.log('## main1 ##');
  console.log(a); // ReferenceError: Cannot access 'a' before initialization
  let a = 1;
}

try {
  main1();
}
catch(err) {
  console.error(err);
}
```

