## Goals

* [ ] We ultimately: capture all semantics of `then`, `Promise` constructor, `Promise.all`, `Promise.race`, `Promise.allSettled` and more...


# Experiments

## Await + Promise ticks

**Conclusion**: Priorities of the different scheduling mechanics are:

```
nextTick < Promise.then = await < setImmediate
```

### Code

[samples/case-studies/async/queuePrioritiesExperiment.js](../tree/master/samples/case-studies/async/queuePrioritiesExperiment.js)

```js
countPromiseTicks();
countAwaitTicks();
countNextTick();
setImmediate(() => {
  console.log('setImmediate');
});


// (async function main() {
//   console.log(1);
//   await u();
//   console.log(2);
// })();


function countPromiseTicks(n = 3) {
  countWith('promise', (...args) => Promise.resolve().then(...args), n);
}

function countNextTick(n = 3) {
  countWith('nextTick', process.nextTick.bind(process), n);
}

async function countAwaitTicks(n = 3) {
  do {
    await 0;
    console.debug('await      tick', n);
  } while (--n);
}

function countWith(name, schedule, n) {
  if (!n) return;
  schedule(() => {
    console.debug(`${name.padEnd(10, ' ')} tick`, n);
    countWith(name, schedule, --n);
  })
}

console.log('eof');
```

### Result
```
eof
nextTick   tick 3
nextTick   tick 2
nextTick   tick 1
promise    tick 3
await      tick 3
promise    tick 2
await      tick 2
promise    tick 1
await      tick 1
setImmediate
```

## Nested `await` vs. `Promise.then`

**Conclusion**: Any `await` or `Promise.then` re-schedules and is never resolved immediately.

[samples/case-studies/async/async_exp1.js](../tree/master/samples/case-studies/async/async_exp1.js)

```js
async function f(x) {
  console.log('f1', x);
  await g(x);
  console.log('f2', x);
}
async function g(x) {
  console.log('g1', x);
  await 0;
  console.log('g2', x);
}


(async function main() {
  console.log('main1');
  f(1);
  f(2);
  f(3);
  Promise.resolve().then(() => console.log(4)).then(() => console.log(44));
  Promise.resolve().then(() => console.log(5)).then(() => console.log(55));
  console.log('main2');
})();
```

### Result

```
main1
f1 1
g1 1
f1 2
g1 2
f1 3
g1 3
main2
g2 1
g2 2
g2 3
4
5
f2 1
f2 2
f2 3
44
55
```

# More resources

* Bluebird implementation of `then` calls [_then](https://github.com/petkaantonov/bluebird/blob/master/src/promise.js#L249) -> [_addCallbacks](https://github.com/petkaantonov/bluebird/blob/master/src/promise.js#L430)
  * The internal queue is processed in [_queueTick](https://github.com/petkaantonov/bluebird/blob/master/src/async.js#L117)
    * That in turn uses [the schedule function](https://github.com/petkaantonov/bluebird/blob/master/src/schedule.js) which choses a native schedule function based on platform. By default it uses `nativePromise.then` (no surprise...)

