## About nested `await`s

* `Pre-await` events of nested `await` calls all happen in the same "async queue" tick
* `Post-await` events of nested `await` calls all happen in separate "async queue" ticks
  * because, [according to the spec](https://tc39.es/ecma262/#sec-promise-resolve-functions), the next task after resolving a Promise, is not executed right away, but put in queue ("`HostEnqueuePromiseJob`")

## Code

```js
async function f() {
  log('f', 1);
  await g();
  log('f', 2);
  await 0;
  log('f', 3);
}

async function g() {
  log('g', 1);
  await (hp = h());
  log('g', 2);
  await 0;
  log('g', 3);

}

async function h() {
  log('h', 1);
  await 0;
  log('h', 2);
}
```

